.dashboard {
  display: flex;
  flex-direction: column;
  align-items: center;
  background-color: #374533;
  color: white;
  height: 100vh;
  padding: 20px;
}
.board {
  display: flex;
  flex-direction: row;
  align-items: center;
  background-color: #374533;
  color: white;
  height: 100vh;
  padding: 20px;
  gap: 20px;
}
.logo img {
  position: absolute;
  top: 20px;
  left: 20px;
  height: 200px;
  width: auto; /* Maintain aspect ratio */
  object-fit: contain;
}
.title {
  margin-top: 120px;
  font-size: 24px;
