  padding: 10px;
  border: none;
  border-radius: 5px;
  cursor: pointer;
  font-size: 18px;
  width: 100%;
  text-align: left;
  padding-left: 20px; /* Indent text for better readability */
  min-height: 160px;
  text-align-last: center;
}
.navButton:hover {
  background-color: #506c3b; /* Darken on hover */
}
.resources {
  display: flex;
  flex-direction: column;
  align-items: center;
  margin-top: 20px;
}
.resources h2 {
  margin-bottom: 10px;
}
